import React from "react";
import NavbarHeader from "../components/header2";
import { NavLink, Route } from "react-router-dom";
import { Layout, Drawer, Navigation, Content } from "react-mdl";

import Rows from "./Rows";
import Banner from "../components/Banner";

const Homepage = () => {
  return (
    <div className="demo-big-content">
      <Layout fixedHeader style={{ background: "#111" }}>
        <NavbarHeader />
        <Drawer title="Title">
          <Navigation>
            <NavLink to="/">Top Rated</NavLink>
            <NavLink to="/">Action Movies</NavLink>
            <NavLink to="/">Horror Movies</NavLink>
            <NavLink to="/">Comedy Movies</NavLink>
            <NavLink to="/">Documentaries</NavLink>
          </Navigation>
        </Drawer>
        <Content>
          <div className="page-content">
            <Route path="/doc" component={Banner} />
            <Rows />
          </div>
        </Content>
      </Layout>
    </div>
  );
};

export default Homepage;
